import { NavLink } from "react-router-dom";

export function MainNavigation() {
  const activeLinkClass =
    "font-medium text-gray-300 border-b p-1 border-teal-400";
  const inactiveLinkClass =
    "font-medium text-gray-300 border-b p-1 border-[#111]";
  return (
    <header>
      <nav>
        <ul className="flex gap-10 p-10 bg-[#111]  shadow shadow-black text-base">
          <li>
            <NavLink
              to="/"
              className={({ isActive }) =>
                isActive ? activeLinkClass : inactiveLinkClass
              }
              end
            >
              <span className="text-xl">H</span>ome
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/events"
              className={({ isActive }) =>
                isActive ? activeLinkClass : inactiveLinkClass
              }
              end
            >
              <span className="text-xl">E</span>vent
            </NavLink>
          </li>
        </ul>
      </nav>
    </header>
  );
}
